import { useState } from "react";

const ToDo = () => {
  const [todoList, setTodoList] = useState([
    "Apple",
    "Banana",
    "Mango",
    "Orange",
    "Pineapple",
  ]);
  const [todo, setToDo] = useState("");
  return (
    <div>
      <h1>Todo Application</h1>

      <form>
        <input type="" name="todo" value={todo} />
        <button type="submit">Add Todo</button>
      </form>
      <ol>
        {todoList.map((todo) => {
          return <li>{todo}</li>;
        })}
      </ol>
    </div>
  );
};

export default ToDo;
